INSERT INTO `leiras` (`ID`, `leiras`, `megepites_eve`, `forras`, `terkep`) VALUES
(4, 'Az Hagia Szophia (ejtsd: ajía szofía, görög betűkkel: Ἁγία Σοφία; latinul: Sancta Sophia; törökül: Ayasofya; újgörögösen: Ajía Szofía; a név jelentése: Szent [= isteni] Bölcsesség) bizánci építésű hajdani ortodox bazilika Isztambulban, Törökországban. 1453-tól, Konstantinápoly oszmán kézre kerülésétől kezdve 1934-ig mecsetként használták, 1934 és 2020 között múzeumként volt látogatható, 2020 júliusa óta azonban újra mecsetként funkcionál.\r\n\r\nNeve kezdetben Nagytemplom (Megalé Ekklészia; Ecclesia Magna) volt. Az akkori általános közvélekedés szerint nem volt hozzá fogható méretű templom az egész korabeli „keresztény világ”-ban. Az utolsó jelentős alkotása a késő ókori építészetnek és egyben az első képviselője annak a specifikusan bizánci architektúrának, melynek szellemében az épület domináns eleme a kupola. Ezt a fő stílusjegyet fejlesztette tovább az oszmán építészet Mimar Szinán építészzseni vezetésével a 16. században.', '537', 'https://hu.wikipedia.org/wiki/Hagia_Szophia', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3010.761962720468!2d28.977986315414135!3d41.00858297930075!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x14cab9be92011c27%3A0x236e6f6f37444fae!2sHagia%20Szophia!5e0!3m2!1shu!2shu!4v1643801734648!5m2!1shu!2shu\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>'),
(6, 'A pisai Dóm tér (Piazza dei Miracoli, azaz Csodák tere) széles terület a toszkánai Pisa városközpontjában (é. sz. 43° 43′ 23″, k. h. 10° 23′ 47″), a középkori művészet alkotásainak kiemelkedő jelentőségű helyszíne. A részben füves, részben kövezett tér négy meghatározó építménye a dóm (Duomo), a ferde torony (Campanile; Torre pendente), a keresztelőkápolna (Battistero) és a temető (Camposanto).', '1987', 'https://hu.wikipedia.org/wiki/D%C3%B3m_t%C3%A9r_(Pisa)', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2883.3884756894236!2d10.393105365500025!3d43.7232561291189!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x12d591a76bad7a8b%3A0x4be4b52e302e7f98!2zRMOzbSB0w6ly!5e0!3m2!1shu!2shu!4v1643802306653!5m2!1shu!2shu\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>'),
(8, 'A San Miniato al Monte bazilika Firenze egyik legrégibb építészeti műemléke, a toszkánai románkori építészet remeke. A firenzei városközponttól délre, az Arno folyó déli partján fekvő domb tetején áll, annak az ősi szentélynek a helyén, ahol Szent Minias ókori vértanú ereklyéit eltemették. Minias örmény herceg volt, aki remeteként élt, de elfogták és a császár jelenlétében lefejezték.', '11.század', 'https://hu.wikipedia.org/wiki/San_Miniato_al_Monte', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2881.6473997794837!2d11.262790915501188!3d43.759418379117776!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x132a53f0c5886e97%3A0x3b3fbfadae9452b0!2sSan%20Miniato%20al%20Monte!5e0!3m2!1shu!2shu!4v1643803755924!5m2!1shu!2shu\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>'),
(13, 'Az esztergomi vár a Duna jobb partján emelkedő, több mint ötven méter magas, szakadékos oldalfalakkal határolt magaslaton áll, a Komárom-Esztergom megyei Esztergom óvárosában. A vár Magyarország középkori történelmének kiemelkedő fontosságú helyszíne. Déli részén működik a Várszínház, a Magyar Nemzeti Múzeum Esztergomi Vármúzeuma, valamint a Panoptikum is. Az épületegyüttes 2008-ban elnyerte az Európai örökség helyszíne kitüntető címet,[1] valamint része az UNESCO világörökségi javaslati listájának, továbbá Esztergom egyik legfőbb látnivalójának számít a bazilikával együtt. 2005-ben avatták fel a várnak a törökországi Ankarában felépített mását, az Estergon Kalesit.[2]', '10. század', 'https://hu.wikipedia.org/wiki/Esztergomi_v%C3%A1r', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d21442.886720454957!2d18.73189812406666!3d47.793840568625896!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x476a61fd42c3f43d%3A0xe9954774baed2654!2sEsztergomi%20v%C3%A1r!5e0!3m2!1shu!2shu!4v1643804023361!5m2!1shu!2shu\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>'),
(14, 'A Notre-Dame Párizs legismertebb gótikus stílusú temploma, a Párizsi főegyházmegye főszékesegyháza. Monumentális méreteivel és díszítettségével különleges hatást gyakorol a szemlélőkre. A Notre Dame francia kifejezés, jelentése: „Mi Asszonyunk”. A katedrális Párizs szívében, a Szajna folyó Île de la Cité nevű apró szigetén épült.', '1345', 'https://hu.wikipedia.org/wiki/Notre-Dame-sz%C3%A9kesegyh%C3%A1z_(P%C3%A1rizs)', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d41999.69373585002!2d2.303830127543206!3d48.858575397473935!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47e671e19ff53a01%3A0x36401da7abfa068d!2sNotre-Dame-sz%C3%A9kesegyh%C3%A1z!5e0!3m2!1shu!2shu!4v1643804593667!5m2!1shu!2shu\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>'),
(15, 'A királyfej a kalocsai érseki székesegyház egyik, bejáratot díszítő szobrához tartozhatott; a kapu ugyancsak vörösmárvány oszloptöredékei a múlt századi ásatások során kerültek elő. A kalocsai kapu a kő és vörösmárvány váltakozásával az esztergomi Szent Adalbert-székesegyház 1196 előtt készült nyugati kapuzatához lehetett hasonló.\r\n\r\nA sommásan megformált királyfej a hazai román kori kőfaragás egyik legszebb darabja. A hátul is gondosan megmunkált férfifejen három görögkereszttel díszített nyitott abroncskoronát látunk, amelynek formája azonos a III. Béla király sírjában talált halotti koronával. A leegyszerűsített és nyugodt formák, a szakáll, a bajusz és a haj párhuzamos, egyenes vonalakkal történt kidolgozása, a tágra nyitott szemek méltóságteljes kifejezést és monumentális jelleget adnak a fejnek. Az ábrázolt kilétére vonatkozóan nincsen biztos adatunk, korábban a székesegyházat alapító Szent István királyra gondoltak, de az is lehetséges, hogy a faragvány a bejáratot díszítő valamelyik bibliai király feje volt.', '1196', 'https://www.hung-art.hu/frames.html?/magyar/zmisc/faragvan/131_sz/kiralyf2.html', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d87861.87345143018!2d18.914560674503573!3d46.5143741753064!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x474256fe32f4036f%3A0xfc1312caa658948c!2sKalocsa%2C%206300!5e0!3m2!1shu!2shu!4v1643805268812!5m2!1shu!2shu\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\"></iframe>');

